using System.IO;

public static class Snippet
{
	public static void RemoveReadOnlyAttribute(System.String filePath)
	{
{ FileAttributes attributes = File.GetAttributes(filePath); 
	if ((attributes & FileAttributes.ReadOnly) == FileAttributes.ReadOnly) File.SetAttributes(filePath, attributes & ~FileAttributes.ReadOnly); }
	}

}
